import React from 'react';
import './Shelf.css'
import Facing from './Facing';
import Card from '../UI/Card';
const Shelf = (props) => {

  console.log(props);

  return (
    <div>
      <Card className='shelf'>
      {props.shelf&&props.shelf.map((facing,index) => (
        <Facing
          key={index}
          shelfID={facing.shelfID}
          facingID={facing.facingID}
          productUPC={facing.productUPC}
          displayFixtureID={facing.displayFixtureID}
        />
      ))}
      </Card>
    </div>
  );
};
export default Shelf;
